$(document).ready(function(){const n=[],t=[];for(let i in compteurConsos)compteurConsos.hasOwnProperty(i)&&(n.push(i),t.push(compteurConsos[i]));const i=["#246421","#2f832c","#3ba537","#46c041","#71ce6d","#8ed88b","#aae2a8","#c7ecc5","d6f1d4"];var r=Math.ceil(i.length/n.length);const u=i.filter(function(n,t){return t%r==0});n.length!==0?new Chart(document.getElementById("doughnut-chart").getContext("2d"),{type:"doughnut",data:{labels:n,datasets:[{label:"Historique",backgroundColor:u,data:t}]}}):($("#doughnut-chart-message").removeClass("d-none"),$("#doughnut-chart").addClass("d-none"))});